import { useState } from 'react'
import { useNavigate } from 'react-router-dom'
import styles from './home.module.css'

const TextGenerator = () => {
    const navigate = useNavigate()
    return (
        <button onClick={() => navigate('/generateText')}>
            Générer le texte
        </button>
    )
}

const Home = () => {
    const [images, getImages] = useState(false)

    useEffect(() => {
        getImages()
    })

    if (images)
        return (
            <div>
                <TextGenerator/>
                <div className={styles.container}>
                    <div className={styles.button}>
                        HUMAN VS IA
                    </div>
                    <div className={styles.button}>
                        HUMAN VS HUMAN
                    </div>
                </div>
            </div>
        )
    return (
        <div>
            CHARGEMENT...
        </div>
    )
}

export default Home
